import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import DevImg from ".//components/DevImg";
import SkillsContainer from "/components/SkillsContainer";

function App() {
  return (
    <div className="App">
      <Container />
    </div>
  );
}
function Container() {
  return (
    <div className="container">
      <DevImg />
      <DevName />
      <BIO />
      <SkillsContainer />
    </div>
  );
}

function DevName() {
  return (
    <header className="header-wrapper">
      <h1 className="header">Nono Piralishvili</h1>
    </header>
  );
}

function BIO() {
  return (
    <div className="bio-wrapper">
      <p className="bio">
        I'm a fast learning, ambitious and hard working individual with high
        sense of responsibility. I'm always open to new challenges and strive
        for gaining new skills and experiences in various fields.
      </p>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
